INSERT INTO `productos` VALUES (1001,1,22,'Intel Core i3-4170 3.7GHz Box','Intel sigue renovando poco a poco su nueva gama de procesadores y en esta ocasión ha apostado por la eficiencia con el core I3-4170T, basado en la arquitectura haswell y fabricado en proceso de 22nm.',14,116.00,10,3,'2016-01-17 10:53:09','s','n',4),(1002,1,22,'Intel Core i5-4690K 3.5Ghz Box','Rendimiento sorprendente y tecnologías visuales sensacionales con velocidad turbo. Suba el listón de su experiencia con el ordenador con unas imágenes fantásticas y un incremento de velocidad cuando lo necesite. La 4ª generación del procesador Intel® Core™ i5 ofrece un rendimiento sorprendente, tecnologías visuales sensacionales y seguridad integrada para una mayor protección. Descubra la emoción de un incremento automático de velocidad cuando lo necesite con la tecnología Intel® Turbo Boost 2.0. Disfrute de sus películas, fotos y videojuegos con total fluidez gracias a un conjunto de mejoras visuales integradas y disfrute durante más tiempo gracias a una mayor autonomía. Consiga un incremento en rendimiento que podrá ver y sentir, y todo mientras disfruta de la tranquilidad que le ofrece la seguridad mejorada. Porque lo único más increíble que la tecnología Intel® es lo que podrá hacer con ella.',14,229.00,0,3,'2016-01-17 10:53:09','n','s',4),(1003,1,22,'Intel Pentium G4400 3.3GHz Box','Si buscas rendimiento, prestaciones y calidad, este es tu fabricante perfecto. te ofrece la mejor combinación calidad precio.',14,68.00,8,3,'2016-01-17 10:53:09','s','n',5),(1004,1,22,'Intel i7-6700K 4.0Ghz Box Reacondicionado','Listos para la multimedia y la creación Lleva la creación de contenidos hasta el siguiente nivel con el nuevo procesador Intel® Core™ i7 Extreme Edition de 8 núcleos. Benefíciate de un enorme rendimiento de 16 hilos para disfrutar de una codificación de vídeo, renderización de imágenes y producción de sonido más rápidas. Libera la potencia de su interior Disfruta de un rendimiento inigualable sin hardware adicional gracias a las tecnologías Intel® integradas y al overclocking habilitado y, luego, configura las especificaciones del sistema como quieras para disfrutar de una flexibilidad adicional. Juegos como nunca antes los habías disfrutado. Domina la competición con un procesador Intel sin bloqueo, características inteligentes exclusivas de Intel y overclocking para contar con un arma potente y flexible cuando necesites un rendimiento incomparable.',14,362.70,12,3,'2016-01-17 10:53:09','n','n',3),(1005,1,22,'Intel Core i3-3250 3.5GHz Box','Haga con unos pocos clics lo que antes eran horas para editar, convertir y compartir sus vídeos... ahora es su vídeo el que le espera a usted y no al revés.',14,120.00,6,3,'2016-01-17 10:53:09','n','n',5),(1006,1,22,'Intel Pentium G2030 3.0GHz Box','La arquitectura Intel® 64 proporciona computación de 64 bits en plataformas de servidor, estación de trabajo, equipos de sobremesa y portátiles cuando se combina con software compatible. La arquitectura Intel 64 mejora el rendimiento al permitir que los sistemas respondan a más de 4 GB de memoria virtual y física. La tecnología Intel SpeedStep® mejorada es una forma avanzada de posibilitar elevados niveles de rendimiento y responder a las necesidades de ahorro de energía de los sistemas portátiles. La tecnología Intel SpeedStep convencional alterna voltaje y frecuencia entre niveles altos y bajos en respuesta a la carga del procesador. Bit de desactivación de ejecución es una característica de seguridad basada en hardware que puede reducir la exposición a virus y ataques con código malicioso y prevenir que software dañino se ejecute y propague en el servidor o en la red. Ayuda a proteger los activos empresariales de sus clientes y reducir la necesidad de costosas reparaciones debidas a virus al crear sistemas con el bit de desactivación de ejecución Intel integrado.',14,59.00,4,3,'2016-01-17 10:53:09','n','n',5),(1007,1,22,'Intel Core i7-3930K 3.2Ghz Box','Con tecnología multi-core más rápida e inteligente que aplica la potencia de procesamiento donde más se le necesita, los procesadores intel core I7 ofrecen un increíble y revolucionario desempeño para pc.',14,469.00,11,3,'2016-01-17 10:53:09','n','n',5),(1008,1,22,'Intel Core i7-4930K 3.4Ghz Box','Lo último en rendimiento sorprendente y tecnologías visuales sensacionales. Disfrute del mejor rendimiento para sus tareas más exigentes con la 4ª generación del procesador Intel® Core™ i7. Para conseguir una diferencia que podrá ver y sentir en HD o en 3-D, multitarea o multimedia, la 4ª generación del procesador Intel Core i7 es perfecta para las tareas más exigentes. Cambie entre aplicaciones sin esfuerzo con la multitarea inteligente de la tecnología Intel® Hyperâ??Threading1. Viva la emoción de un incremento automático en velocidad cuando la necesite con la tecnología Intel® Turbo Boost 2.02. Disfrute de sus películas, fotos y videojuegos con total fluidez gracias a un conjunto de mejoras visuales integradas, sin necesidad de hardware adicional.',14,526.00,7,3,'2016-02-10 10:53:09','n','n',5),(1009,1,22,'Intel Core i7-5960X 3 Ghz Box','Listos para la multimedia y la creación. Lleva la creación de contenidos hasta el siguiente nivel con el nuevo procesador Intel® Core™ i7 Extreme Edition de 8 núcleos. Benefíciate de un enorme rendimiento de 16 hilos para disfrutar de una codificación de vídeo, renderización de imágenes y producción de sonido más rápidas. Libera la potencia de su interior. Disfruta de un rendimiento inigualable sin hardware adicional gracias a las tecnologías Intel® integradas y al overclocking habilitado y, luego, configura las especificaciones del sistema como quieras para disfrutar de una flexibilidad adicional. Juegos como nunca antes los habías disfrutado. Domina la competición con un procesador Intel sin bloqueo, características inteligentes exclusivas de Intel y overclocking para contar con un arma potente y flexible cuando necesites un rendimiento incomparable.',14,1142.00,5,3,'2016-02-10 10:53:09','n','n',4),(1010,1,22,'Intel Core Xeon E5-2620 v3 2.4 Ghz Box','Los servidores, estaciones de trabajo y soluciones de almacenamiento basadas en la nueva familia de procesadores Intel® Xeon® E5 ofrecen la mejor combinación de rendimiento, prestaciones integradas y rentabilidad que permiten que los centros de datos sean más flexibles y eficientes. Se sentirá encantado de poder disfrutar del mejor rendimiento posible, desde la virtualización y las soluciones del cloud computing hasta el diseño de la automatización o las transacciones financieras en tiempo real, independientemente de las tareas que afronte.Su inversión en tecnología estándar de la industria de Intel en combinación con las innovadoras soluciones de nuestros socios le ayudarán a preparar su centro de datos para el futuro con una infraestructura que crece con su negocio. La tecnología se dirige a escalar los innovadores servicios de la nube privada Las nubes privadas actuales permiten una mayor agilidad y eficiencia empresarial ofreciendo servicios innovadores y escalables que devuelven el valor a las organizaciones a las que sirven. Crear y gestionar estos servicios requiere de sistemas que se escalan para satisfacer sus necesidades cada vez más cambiantes, al tiempo que ofrecen soluciones para los retos diarios que afrontan los administradores de TI. Las plataformas para servidores y almacenamiento equipadas con la familia de procesadores Intel® Xeon® E5 están integradas en el epicentro de los centros de datos actuales y permiten contar con soluciones de nube privada potentes y versátiles.',14,475.00,8,3,'2016-01-17 10:53:09','n','n',5),(1011,1,2,'AMD Sempron 3850 1.3 GHz Box','Diseñada para crecer junto con tus necesidades. Utiliza la plataforma AM1 flexible y selecciona la APU Athlon™ o Sempron™ de AMD que sea adecuada para ti. Aumenta el rendimiento de tu equipo a medida que tu plataforma AM1 se actualiza y mejora. Aprovecha las ventajas con un rendimiento accesibl