able de múltiples tareas y puro rendimiento de núcleo con la arquitectura “Bulldozer”. Capacidad para ofrecer el rendimiento necesario sin elevar los requerimientos de energía. Un líder de la industria en el precio por el rendimiento. Los procesadores desbloqueados ofrecen el máximo rendimiento ajustable. La tecnología AMD Turbo Core ajusta dinámicamente el rendimiento para brindar la mejor experiencia, sin importar las tareas que se realicen. Rendimiento superior a un precio competitivo con la tecnología desbloqueada.',15,171.00,10,3,'2016-01-17 10:53:09','n','n',3),(1014,1,2,'AMD FX-8370E 3.3 GHz Box','Los procesadores AMD FX desbloquean un rendimiento de procesamiento máximo y sin limitaciones para una capacidad de respuesta extrema que se puede ver y sentir. El primer procesador de escritorio de 8 núcleos de la industria .Capacidad de overclocking con la tecnología fácil de usar AMD Overdrive y paquetes de software AMD Catalyst Control Center. Poder supremo disponible con prácticamente cualquier configuración de núcleos (también disponible en variantes de 6 y 4 núcleos) Rendimiento intenso para ejecución de múltiples tareas y aplicaciones intensivas, como la edición de video y modelos 3D. El primer procesador nativo de escritorio de 8 núcleos de la industria para una ejecución inigualable de múltiples tareas y puro rendimiento de núcleo con la arquitectura “Bulldozer”. Capacidad para ofrecer el rendimiento necesario sin elevar los requerimientos de energía. Un líder de la industria en el precio por el rendimiento. Los procesadores desbloqueados ofrecen el máximo rendimiento ajustable. La tecnología AMD Turbo Core ajusta dinámicamente el rendimiento para brindar la mejor experiencia, sin importar las tareas que se realicen. Rendimiento superior a un precio competitivo con la tecnología desbloqueada.',15,185.00,3,3,'2016-02-10 10:53:09','n','n',4),(1015,1,2,'AMD A10-7850K 3.7Ghz','Presentamos la tecnología de APU más avanzada de AMD. El A10-7870K de AMD es desafiante, con la definición de un procesador con hasta 12 núcleos de cómputo (4 CPU + 8 GPU)* y la innovadora arquitectura GCN (Graphics Core Next). Las APU de AMD serie A utilizan las tecnologías Turbo Core de AMD más modernas para maximizar el rendimiento de la CPU y la GPU en sus aplicaciones más nuevas, permitiendo así hasta 4,1 GHz de rendimiento de la CPU para proporcionar una experiencia increíble. Obtén un rendimiento extremo con la arquitectura GCN. Sumérgete en una moderna tecnología de gráficos con la arquitectura GCN (Graphics Core Next) de AMD. Esta tecnología de tercera generación desbloquea características avanzadas y el deslumbrante rendimiento de los gráficos AMD Radeon™.10. Mejora tu juego con DirectX™ 12, Vulkan™? y Mantle. Las nuevas APU de AMD serie A admiten API de gráficos más modernas para que los juegos de última generación sean una realidad. Con compatibilidad para las tecnologías más modernas en las últimas APU de AMD, puedes jugar con niveles de rendimiento sin precedente, con efectos y detalles increíbles.10. La tecnología AMD TrueAudio proporciona un audio envolvente de 32 canales para que los juegos suenen mejor y ofrezcan un reconocimiento de voz más preciso. Experimenta un nivel totalmente nuevo de inmersión.',15,131.00,4,3,'2016-01-17 10:53:09','n','n',4),(1016,1,2,'AMD A10-5800K 3.80Ghz','Presentamos la tecnología de APU más avanzada de AMD. El A10-7870K de AMD es desafiante, con la definición de un procesador con hasta 12 núcleos de cómputo (4 CPU + 8 GPU)* y la innovadora arquitectura GCN (Graphics Core Next). Las APU de AMD serie A utilizan las tecnologías Turbo Core de AMD más modernas para maximizar el rendimiento de la CPU y la GPU en sus aplicaciones más nuevas, permitiendo así hasta 4,1 GHz de rendimiento de la CPU para proporcionar una experiencia increíble. Obtén un rendimiento extremo con la arquitectura GCN. Sumérgete en una moderna tecnología de gráficos con la arquitectura GCN (Graphics Core Next) de AMD. Esta tecnología d