ta de los graves, las explosiones son la bomba. El micrófono con supresión de ruido transmite con claridad las órdenes verbales a los demás miembros del equipo y puede desmontarse para guardarlo fácilmente o para utilizar los auriculares de forma convencional. En el fragor del combate, estos auriculares no te darán la espalda; por eso los utiliza Johnathan «Fatal1ty» Wendel, el jugador profesional más famoso del mundo.',1,29.91,3,3,'2016-01-17 10:53:10','n','n',5),(16018,16,37,'Auriculares Sony MDR-RF811RK','Auriculares domésticos inalámbricos con diafragmas de 40 mm, alcance de recepción hasta 100 m y diadema autoajustable. El alcance inalámbrico de hasta 100 m te ofrece libertad de movimientos. Transmisión inalámbrica por RF clara. Hasta 13 horas de duración de batería. Diadema autoajustable para mayor comodidad durante la escucha.',2,42.00,34,10,'2016-01-17 10:53:10','n','n',3),(16019,16,32,'GamePad Qumox 2x','PC GamePad controlador SFC para Super Famicom Windows PC USB. El cable es de 6 pies de largo aproximadamente. Enchúfelo y úselo, sin necesidad de controladores adicionales. ¡Juegue sus juegos de computadora con una sensación retro de la vieja escuela! ¡Es así de simple! ¡Simplemente enchúfelo y úselo sin necesidad de controladores adicionales!.El super control de mando de 16 bit se caracteriza por 8 botones fáciles de alcanzar en un control diseñado para ajustarse al contorno de sus manos. El Paquete incluye: 2 x Controles de mandos SFC para PC USB MAC Versión japonesa.',1,9.22,18,7,'2016-02-10 10:53:09','n','n',4),(16020,16,45,'Tableta gráfica Wacom CTL-490DW-S Intuos Draw','Pen Tablet Intuos Draw. Todo lo que necesitas para empezar a crear hoy mismo. Con Intuos Draw, crear es un proceso divertido. Esboza, dibuja y pinta fácilmente en tu ordenador: ¡tan sencillo como con un lápiz! Incluso los principiantes pueden llevar su obra a un nivel superior en poco tiempo y con poco esfuerzo. Intuos Draw abre todo un nuevo mundo de posibilidades. Dispondrás de una gama completa de material artístico, todo en una herramienta. Utiliza el lápiz para esbozar o dibujar. Y, a continuación, convierte tu lápiz en un pincel virtual. O un almacén repleto de colores. O rotuladores, lápices, papel, pegamento. . . todo depende de tu imaginación. Intuos Draw es lo que necesitas, siempre que lo necesites. Está diseñada tanto para zurdos como para diestros, y funciona con cualquier aplicación de software. Intuos Draw también incluye el software de dibujo y esbozo ArtRage Lite, así como tutoriales en línea para que comiences a crear directamente.',2,62.00,15,3,'2016-01-17 10:53:10','n','n',4),(16021,16,40,'Cargador universal para portátil - Tacens ANBP100','Cargador universal de portátil compacto de 100W para uso en el hogar. Compatible con la mayoría de marcas de portátiles. Fabricado en aluminio de alta calidad para la mejor protección y refrigeración. 8 conectores IBM, SONY, TOSHIBA, HP/COMPAQ, DELL, ACER, FUJITSU, SHARP. 8 voltajes 12V/ 15V/ 16V/ 18V/ 19V/ 20V/ 22V/ 24V. Alta eficiencia de hasta un 90% con protección de corto-circuito, sobrecarga y sobrecalentamiento. Conector USB para poder cargar cualquier dispositivo USB. Voltaje universal de entrada AC 100-240V. 3.5”. Nota: el tipo de enchufe varía según el país.',1,16.40,29,11,'2016-01-17 10:53:10','n','n',5),(16022,16,3,'S.A.I. APC BX950UI','El modelo BX950UI ofrece una protección eléctrica garantizada para redes inalámbricas, ordenadores, consolas de videojuegos y otros equipos electrónicos de su hogar u oficina. El BX950UI proporciona respaldo de batería durante interrupciones y fluctuaciones inseguras de la tensión, y además ofrecen protección contra subidas y picos de tensión dañinos, siendo la opción perfecta para proteger sus datos y mantenerse conectado. Interruptor de circuito reajustable.',2,99.10,7,2,'2016-01-17 10:53:10','n','n',5),(16023,16,25,'S.A.I. L-Link LL-1550R','Función automática de AVR. Técnica de regulación PWM y componentes avanzados de potencia MOSFET, garantiza un rendimiento estable. Avance automático del circuito de carga constante, prolonga la vida de la batería. Protección de la batería de bajo voltaje',1,37.95,13,5,'2016-01-17 10:53:10','n','n',4),(16024,16,47,'Lector de tarjetas Woxter DNI Electrónico','Permite leer el nuevo DNI electrónico y también es compatible con las tarjetas Smart Cards o \"Tarjetas inteligentes\" (tarjetas con circuito integrado). Es un accesorio imprescindible para quienes deseen disfrutar de las ventajas que ofrece el nuevo DNI: identificación a través de Internet, gestiones a través de la red y desde casa sin esperar colas ni desplazarse. Gracias a que es también compatible con tarjetas Smart Cards el lector permite realizar operaciones bancarias seguras a través de Internet. El lector incorpora dos LEDs, uno de encendido, LED rojo y otro que indica el estado de lectura/escritura de la unidad, LED verde. Soporta 3V/5V IC Smart Card. Velocidad de lectura máx. 115,200 bps. Se conecta al PC a través del puerto USB 2.0 y se alimenta también a través de dicho puerto, por lo que su consumo es mínimo. Sistema operativos compatibles: Win98/ME/2000/XP/Vista/Linux. Cumple con los estándares y protocolos necesarios que garantizan la compatibilidad con el DNI electrónico, así como con las tarjetas de crédito con formato Smart Card: ISO7816 1/2/3 y los protocolos T=0 y T=1.',2,11.99,17,8,'2016-01-17 10:53:10','n','n',3),(17001,17,4,'Asus PCE-AC56 Adaptador WiFi PCI-E AC1300','Mejora instantánea a Wi-Fi 802.11ac para tu PC de sobremesa:olvídate de las marañas de cables Ethernet. La nueva generación del chipset 802.11ac permite alcanzar rapidísimas conexiones de hasta 867 Mbps. Funcionamiento seleccionable en dual-band 2,4 GHz/5 GHz, compatible con todos los dispositivos existentes. La tecnología Broadcom® TurboQAM™ ofrece un rendimiento un 33 % superior al de 802.11n, con velocidades de hasta 400 Mbps. La alta potencia de este diseño aumenta el área de cobertura un 150 %. El exclusivo disipador ofrece un funcionamiento más estable y fiable.',3,41.28,9,9,'2016-01-17 10:53:10','n','n',5),(17002,17,4,'Asus PCE-AC68 PCI-E WiFi Dual-Band AC1900 - Tarjeta PCI','Te presentamos el AC1900 de Asus, un adaptador wireless PCI-E de doble banda. El ASUS PCE-AC68 es un nuevo adaptador PCI Express Wi-Fi 802.11ac,  elegante base de la antena magnética externa le da más flexibilidad en el ajuste de la colocación de la antena para obtener la mejor calidad de recepción de señal posible',3,68.55,7,4,'2016-01-17 10:53:10','n','n',4),(17003,17,4,'Asus PCE-N10 150Mbps 11n Wireless PCI Express - Tarjeta','Adaptador inalámbrico 802.11N PCI Express 150Mbps para tu sobremesa. El botón WPS permite configurar una conexión inalámbrica segura con facilidad. El modo Software AP permite emplear la tarjeta WLAN como punto de acceso y conecta tu portátil o consola de juegos a internet.. Compatible con los métodos de cifrado de seguridad WEP, WPA y WPA2',4,10.70,3,5,'2016-01-17 10:53:10','n','n',5),(17004,17,4,'Asus PCE-N15 WiFi 11n 300Mbps Perfil Bajo - Tarjeta Eth','Adaptador PCI-E Wireless 802.11b/g/n 300Mbps. Software AP – Conecta tu portátil o consola a internet. Compatible con los estándares de seguridad WEP, WPA-PSK, and WPA2-PSK',4,12.36,1,1,'2016-01-17 10:53:10','n','n',4),(17005,17,12,'D-Link DGE-528T Tarjeta de Red Gigabit 10/100/1000','La tarjeta de red Gigabit Ethernet DGE-528T de 32 / 64 bits es la opción propuesta por D-Link para habilitar estaciones de trabajo a Gigabit y que proporciona al usuario hasta 2000Mbit de trasmisión de datos en Full / Dúplex. La DGE-528T es una solución alternativa y económica a la conexión de fibra, proporcionando velocidad Gigabit y segurida',4,13.18,28,6,'2016-01-17 10:53:10','n','n',3),(17006,17,15,'Edimax EN-9260TX-E V2 Adaptador Gigabit Ethernet PCI Ex','Te presentamos en PcComponentes la EN-9260TX-E de Edimax, una tarjeta PCI Express con tecnología Gigabit Ethernet. El adaptador de red EN-9260TX-E para PC con ranuras PCI Express ofrece lo último en tecnología de administración de energía y capacidad de conexión de redes Gigabit Ethernet. La capacidad de ancho de banda completa EN-9260TX-E dispone de una sólida capacidad de 1000 Mbps a través de la arquitectura de bus PCI Express. No es necesario adquirir un nuevo modificador o enrutador de ancho de banda puesto que la propiedad de negociación automática del adaptador trabaja con el modificador, el enrutador de ancho de banda existentes o el hub existentes para proporcionar la máxima velocidad de red disponible (10/100 o 1000 Mbps). La doble capacidad completa del adaptador aumenta aún más el ancho de banda y elimina las colisiones de paquete permitiendo el tráfico simultáneo de datos en ambas direcciones. Cumple el estándar PCI Express 1.1 – x1 PCI Express. Cumple las normas IEEE 802.3, 802.3u, 802.3ab, 802.3z. Compatible con tramas gigantes y negociación automática 10/100/1000 Mbps. Compatible con control de tráfico de dúplex completo IEEE802.3x. Compatible con el etiquetado IEEE802.1Q VLAN y la codificación prioritaria IEEE802.1P Layer2. Compatible con la gestión de encendido Wake On LAN y ACPI. Compatible con la función Ethernet de eficiencia energética IEEE802.3az. Incluye bracket de perfil bajo. Plug-and-Play. Compatible con los controladores Novell 5.X/6.X, Windows 98/ME/NT4.0/2000/XP/Vista/7/8, Linux 2.4.',4,9.88,18,12,'2016-01-17 10:53:10','n','n',4),(17007,17,15,'Edimax EW-7612PIN V2 300Mbps 11n Wireless PCI Express','EW-7612PIn es un adaptador PCI Express inalámbrica que proporciona una manera simple y fácil para agregar o actualizar la conectividad inalámbrica en el escritorio. Este adaptador PCI Express inalámbrica admite velocidades de datos más altas hasta 300Mpbs cuando se conecta a un dispositivo inalámbrico 802.11n. También puede conectarse a cualquier punto de acceso inalámbrico público para el acceso a Internet para recuperar correo electrónico, sitios web de surf o utilizar la mensajería instantánea. EW-7612PIn le da la libertad para unirse a la red.',4,12.36,17,3,'2016-01-17 10:53:10','n','n',3),(17008,17,15,'Edimax EW-7822PIC Dual AC1200 Wi-Fi Adaptador PCI-E','El estándar de transmisión inalámbrica 802.11ac de última generación está revolucionando el Wi-Fi. Los enrutadores superveloces de doble banda 802.11ac ya están disponibles, pero los dispositivos inalámbricos todavía siguen con la tecnología 802.11n. Actualice su ordenador de escritorio a la doble banda 802.11ac con el adaptador PCI-E y obtendrá una velocidad Wi-Fi vertiginosa en la banda de frecuencia de 5 Ghz. El EW-7822PIC está dotado de dos antenas extraíbles de alta ganancia que proporcionan cobertura Wi-Fi de alto rendimiento. Incluye un soporte magnético adicional para encontrar la mejor ubicación de la antena y optimizar el alcance de funcionamiento de la transmisión inalámbrica y es compatible con las versiones anteriores de dispositivos inalámbricos con 802.11a/b/g/n',4,46.24,3,1,'2016-01-17 10:53:10','n','n',5),(17009,17,27,'LevelOne GNC-0112 PCI-E Gigabit Ethernet 10/100/1000','Tarjeta de red Gigabit de alta velocidad compatible con PCI Express v1.1 Admite PCI Express de un carril que proporciona una velocidad de transmisión de enlace de hasta 2,5 Gbps Admite colas de prioridad IEEE 802.1P Nivel 2 para mejorar el flujo del tráfico La VLAN IEEE 802.1Q permite segmentación de la red para mejorar el rendimiento y la seguridad El control de flujo IEEE 802.3x evita la pérdida de paquetes para mejorar la fiabilidad de la transmisión de datos. Detección automática de velocidad de red Indicador LED para supervisar el enlace y la actividad. Soporta Windows 2000/XP/2003/Vista/7/8',5,13.84,5,2,'2016-01-17 10:53:10','n','n',3),(17010,17,38,'StarTech Tarjeta de Red PCI Express Puerto Gigabit Ethe','La tarjeta de red Gigabit PCIe de perfil bajo, modelo ST1000SPEX2L, agrega un puerto Ethernet RJ45 compatible con 10/100/1000 Mbps a un cliente, una estación de trabajo o un servidor con ranura PCI Express disponible, convirtiéndose en una práctica interfaz de red adicional o de reemplazo.?Conforme con las normas IEEE 802.3/u/ab y con soporte para tramas Jumbo 9K, etiquetado VLAN y reinicio WOL (\"Wake on LAN\", reinicio mediante red), este versátil adaptador gigabit de red o de servidor ofrece un rendimiento de red efectivo.?La tarjeta viene preconfigurada con un bracket para su instalación en perfil bajo/altura media e incluye también un bracket de perfil estándar para su instalación en una amplia gama de cajas de PC/servidor, sin importar su factor de forma.?Respaldada por la garantía de dos años de StarTech.com y con soporte técnico gratuito de por vid',5,23.14,16,10,'2016-01-17 10:53:10','n','n',3),(17011,17,42,'TP-LINK Archer T8 AC1750 Wireless Dual Band PCI Express','El Archer T8E de TP-LINK viene con el estándar Wi-Fi de la próxima generación – 802.11ac, 3 veces más rápido que las velocidades N inalámbricas. Con 1300Mbps de velocidad inalámbrica sobre la banda cristalina libre de interferencias de 5GHz o 450Mbps sobre la banda de 2.4GHz, el Archer T8E es la elección superior para streaming HD sin interrupciones, juego online y otras tareas intensivas en ancho de banda.',5,47.11,8,5,'2016-01-17 10:53:10','n','n',4),(17012,17,42,'TP-LINK Archer T6e Adaptador Pci Express Dual Band Ac13','El Archer T6E de TP-LINK viene con el estándar Wi-Fi de la nueva generación – 802.11ac, ofreciendo tasas de transferencia que son 3 veces más rápidas que la velocidad inalámbrica N. Actualice su sistema de escritorio fácilmente simplemente conectando el adaptador Wi-Fi en una ranura PCI-E disponible',5,33.02,29,11,'2016-01-17 10:53:10','n','n',3),(17013,17,42,'TP-LINK Archer T9E 600Mbps Wireless Dual Band PCI Expre','El Archer T9E de TP-LINK viene con el estándar Wi-Fi de la próxima generación – 802.11ac, 3 veces más rápido que la velocidad inalámbrica N. Con velocidades inalámbricas de 1300Mbps sobre la cristalina banda de 5GHz o de 600Mbps sobre la banda de 2.4GHz, el Archer T9E es la mejor elección para transmisión de video HD sin retrasos, juego online y otras tareas intensivas de ancho de banda.',6,49.59,23,15,'2016-01-17 10:53:10','n','n',5),(17014,17,42,'TP-LINK DGE-Tarjeta de Red Gigabit 10/100/1000','El adaptador de red PCIe Gigabit a 10/100/1000 Mbps TG-3468 es una solución Ethernet PCI Gigabit de 32 bits altamente integrada y asequible que es totalmente compatible con los estándares IEEE 802.3, IEEE 802.3u y IEEE 802.3ab. El adaptador PCIe Gigabit TG-3468 es un dispositivo de altas prestaciones diseñado para arquitectura de bus de alta velocidad PCI Express. Soporta y detecta automáticamente velocidades de red de 10/100/1000 Mbps e incorporta funciones tales como control de flujo 802.3x y Wake-on-LAN. El adaptador de red PCIe Gigabit TG-3468 es una solución Ethernet Gigabit altamente integrada y asequible que constituye una buena opción para actualizar su red.',3,11.36,2,1,'2016-01-17 10:53:10','n','n',3),(17015,17,42,'TP-LINK TG-3269 Tarjeta de Red Gigabit 10/100/1000 PCI','G-3269 es una tarjeta de red 10/100/1000Mbps, 32-bit 33/66 MHz PCI-bus Gigabit Ethernet. Soporta ACPI y es compatible con PCI 2.2',3,9.88,22,14,'2016-01-17 10:53:10','n','n',5),(17016,17,42,'TP-LINK TL-WDN3800 300Mbps Wireless N Dual Band PCI Exp','Soporte de doble banda - los canales de 2,4 GHz o 5 GHz permiten un optimizado streaming de vídeo de alta definición, intercambio de archivos y la mejor experiencia en línea Velocidades inalámbricas de hasta 300 Mbps Dos antenas aumentar el rendimiento inalámbrico y la estabilidad',3,23.14,2,3,'2016-01-17 10:53:10','n','n',5),(17017,17,42,'TP-LINK TL-WDN4800 450Mbps Wireless N Dual Band PCI Exp','450 Mbps TP-LINK Wireless N de banda dual PCI Express Adapter, TL-WDN4800 le permite conectar un ordenador de sobremesa a una red inalámbrica y el acceso a una conexión de alta velocidad de la red inalámbrica. Cumplir con los estándares IEEE 802.11a/b/g/n, el dispositivo puede utilizar los canales 2,4 GHz o 5 GHz y proporciona velocidades inalámbricas de hasta 450Mbps, que es ideal para usuarios que buscan un muy robusto, ancho de banda intensivo de la experiencia de red inalámbrica, en particular con vídeo de alta definición streaming y juegos en línea',2,30.58,7,1,'2016-01-17 10:53:10','n','n',4),(17018,17,42,'TP-LINK TL-WN781ND 150Mbps 11n Wireless PCI Express','El TL-WN781N de TP-LINK está diseñado para proporcionar un rendimiento inalámbrico integral desde el servidor o backbone del servidor hasta la infraestructura del conmutador pasando por el ordenador con el conector PCI Express. El Adaptador Inalámbrico TL-WN781N Lite N PCI Express(x1) ofrece una alta compatibilidad, se adapta a cualquier ranura PCI Express estándar, x1, x4, x8, o x16. Comparado con las tarjetas de red PCI estándar, ofrece más ancho de banda, fiabilidad y funcionalidad, permitiéndole disfrutar una conexión rápida y avanzada, para sus descargas, llamadas por Internet o video streaming.',2,12.19,21,16,'2016-01-17 10:53:10','n','n',3),(17019,17,42,'TP-LINK TL-WN881ND 300Mbs 11n Wireless PCI Express','Velocidad inalámbrica N de hasta 300 Mbps es ideal para la difusión de vídeo, juegos en línea y las llamadas por Internet. 2T2R MIMO ™ ofrece mayor rendimiento en la gama convencional versus 1T1R. Fácil configuración de una conexión inalámbrica de alta seguridad con software embebido QS',2,12.19,2,2,'2016-01-17 10:53:10','n','n',3),(17020,17,22,'Intel EXPI9301CTBLK - Tarjeta de red',' El adaptador Intel® Gigabit CT Desktop es una tarjeta de red para Gigabit para un slot PCI-Express-Slot a partir de x1. La transferencia de datos de 1,000 Mbit/s se puede lograr con un cable de cobre CAT5 convencional. Así se pueden alcanzar distancias hasta 100 metro',2,32.50,17,9,'2016-01-17 10:53:10','n','n',5);
